import React, { useEffect } from 'react'
import TaskCard from '../components/Cards/TaskCard'
import { httpGet } from '../libs/http'

const index = () => {

    useEffect(() => {
        
        httpGet()

    }, [])

    return (
        <div>
            <h1>hola mundo</h1>
            <TaskCard />
        </div>
    )
}

export default index
